import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Copy, Check, Shield, Download } from 'lucide-react';

const OutputCard = ({ content }) => {
  const [copiedHash, setCopiedHash] = useState(false);
  const [isSigning, setIsSigning] = useState(false);

  // Mock hash generation
  const generateHash = (text) => {
    return '0x' + Array.from(text)
      .reduce((hash, char) => (hash << 5) - hash + char.charCodeAt(0), 0)
      .toString(16)
      .slice(0, 64);
  };

  const hash = generateHash(content?.content || '');

  const copyHash = async () => {
    await navigator.clipboard.writeText(hash);
    setCopiedHash(true);
    setTimeout(() => setCopiedHash(false), 2000);
  };

  const signWithMetaMask = async () => {
    setIsSigning(true);
    // Simulate MetaMask signing
    await new Promise(resolve => setTimeout(resolve, 3000));
    setIsSigning(false);
  };

  if (!content) return null;

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ delay: 0.2 }}
      className="gradient-border rounded-2xl"
    >
      <div className="glass-morphism rounded-2xl p-8">
        <h2 className="text-2xl font-bold text-white mb-6 flex items-center gap-2">
          <Shield className="h-6 w-6 text-green-400" />
          Generated Content
        </h2>

        <div className="space-y-6">
          {/* Content Preview */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.4 }}
            className="bg-black/30 rounded-xl p-6 border border-white/10"
          >
            <h3 className="text-xl font-semibold text-white mb-4">{content.title}</h3>
            <p className="text-gray-300 whitespace-pre-wrap">{content.content}</p>
            
            {/* Mock Image */}
            {content.image && (
              <motion.img
                initial={{ opacity: 0, scale: 0.8 }}
                animate={{ opacity: 1, scale: 1 }}
                transition={{ delay: 0.6 }}
                src={content.image}
                alt="Generated content"
                className="mt-4 rounded-lg w-full max-w-md mx-auto"
              />
            )}
          </motion.div>

          {/* Hash Display */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 0.8 }}
            className="bg-black/40 rounded-xl p-4 border border-purple-500/30"
          >
            <div className="flex items-center justify-between mb-2">
              <span className="text-sm font-medium text-gray-300">SHA256 Hash:</span>
              <motion.button
                onClick={copyHash}
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                className="flex items-center gap-2 px-3 py-1 bg-purple-600 rounded-lg text-white text-sm"
              >
                {copiedHash ? <Check size={16} /> : <Copy size={16} />}
                {copiedHash ? 'Copied!' : 'Copy Hash'}
              </motion.button>
            </div>
            <code className="text-xs text-green-400 break-all font-mono">
              {hash}
            </code>
          </motion.div>

          {/* Action Buttons */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ delay: 1 }}
            className="flex flex-col sm:flex-row gap-4"
          >
            <motion.button
              onClick={signWithMetaMask}
              disabled={isSigning}
              whileHover={{ scale: isSigning ? 1 : 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="flex-1 py-3 bg-orange-500 hover:bg-orange-600 disabled:bg-orange-800 rounded-xl font-semibold text-white transition-all duration-300 flex items-center justify-center gap-2"
            >
              <AnimatePresence mode="wait">
                {isSigning ? (
                  <motion.div
                    key="signing"
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    exit={{ opacity: 0 }}
                    className="flex items-center gap-2"
                  >
                    <motion.div
                      animate={{ rotate: 360 }}
                      transition={{ duration: 1, repeat: Infinity, ease: "linear" }}
                      className="w-4 h-4 border-2 border-white border-t-transparent rounded-full"
                    />
                    Signing...
                  </motion.div>
                ) : (
                  <motion.div
                    key="sign"
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    exit={{ opacity: 0 }}
                    className="flex items-center gap-2"
                  >
                    <Shield size={18} />
                    Sign with MetaMask
                  </motion.div>
                )}
              </AnimatePresence>
            </motion.button>

            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="flex-1 py-3 glass-morphism border border-white/20 hover:border-white/40 rounded-xl font-semibold text-white transition-all duration-300 flex items-center justify-center gap-2"
            >
              <Download size={18} />
              Download Content
            </motion.button>
          </motion.div>
        </div>
      </div>
    </motion.div>
  );
};

export default OutputCard;
